import React from 'react'
import CotizacioneNuevaForm from './CotizacionNuevaForm'

const CotizacioneNueva = () => {

    return (
        <div className="content-container">
            <h1 className="content-title">Cotizaciones</h1>
            <div className="form-container">
                <CotizacionNuevaForm />
            </div> 
        </div>
    )
}

export default CotizacionNueva
